  const [projetN] = useState(projectsData);
  const numberP = projetN[props.numberOne];
  console.log([projetN.length]);

  return (
    <div>
      <h1 key={numberP.id}>{numberP.title}</h1>
    </div>
  );
};

export default ProjectOne;
